package main;

import mp.bridgeSceneFigures.ABridgeScene;
import mp.bridgeSceneFigures.BridgeScene; 
import mp.bridgeSceneObject.Line; 
import mp.bridgeSceneObject.ALine; 
import bus.uigen.OEFrame;
import bus.uigen.ObjectEditor;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.misc.ThreadSupport;

@StructurePattern(StructurePatternNames.BEAN_PATTERN)
public class Assignment1 {

	static final int QUICK_SLEEP=100, SHORT_SLEEP=1000, MEDIUM_SLEEP=3000, LONG_SLEEP=5000; 
	static final int RUN_X=-10, ROTATE_LEFT=-4, ROTATE_RIGHT=4;  


	public static void animateLine() {



		int totalMoves = 20; 

		Line myLine = new ALine();
		OEFrame anOEFrame = ObjectEditor.edit(myLine);
    	anOEFrame.showTreePanel();

    	for (int i=0; i<totalMoves; i++) {
    		myLine.rotate((int) (10* Math.random()));
    		anOEFrame.refresh(); 
    		ThreadSupport.sleep(SHORT_SLEEP);
    		myLine.setX(100 + 10*i);
    		anOEFrame.refresh();
    		ThreadSupport.sleep(SHORT_SLEEP);
    	}
	}

	public static void demonstrateBridgeScene() {

		BridgeScene myScene = new ABridgeScene(); 

		OEFrame anOEFrame = ObjectEditor.edit(myScene); 
		anOEFrame.showTreePanel();

		ThreadSupport.sleep(SHORT_SLEEP);

		myScene.getArthur().setChatBoxText("Good Day!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getArthur().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().setChatBoxText("Who goes there!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getLancelot().setChatBoxText("Lancelot is Here!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getLancelot().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGalahad().setChatBoxText("It is I, Galahad");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGalahad().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getRobin().setChatBoxText("This should be easy");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");
		anOEFrame.refresh();

		myScene.getGuard().scale(2);
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getGuard().setChatBoxText("I ASKED WHO GOES THERE!");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);

		myScene.getRobin().setChatBoxText("Okay, so maybe this will be a bit harder than expected");
		anOEFrame.refresh();
		ThreadSupport.sleep(MEDIUM_SLEEP);
		myScene.getRobin().setChatBoxText("");

		for (int i=0; i<18; i++) {
			myScene.getRobin().move(RUN_X, 0); 
			myScene.getRobin().getArms().getLeftLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getLegs().getLeftLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getArms().getRightLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getLegs().getRightLine().rotate(ROTATE_RIGHT);
			anOEFrame.refresh();
			ThreadSupport.sleep(QUICK_SLEEP);
			myScene.getRobin().getLegs().getLeftLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getArms().getLeftLine().rotate(ROTATE_RIGHT);
			myScene.getRobin().getArms().getRightLine().rotate(ROTATE_LEFT);
			myScene.getRobin().getLegs().getRightLine().rotate(ROTATE_LEFT);
			anOEFrame.refresh();
			ThreadSupport.sleep(QUICK_SLEEP); 
		}

		myScene.getGuard().scale(0.5);
		myScene.getGuard().setChatBoxText("");
		anOEFrame.refresh();

}




	public static void main(String[] args) {    
		ThreadSupport.sleep(SHORT_SLEEP);
		demonstrateBridgeScene();

	}


}

